from selenium import webdriver
from selenium.webdriver.common.by import By
from selenium.webdriver.common.keys import Keys
from selenium.webdriver.chrome.service import Service
from selenium.webdriver.chrome.options import Options
from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC
from webdriver_manager.chrome import ChromeDriverManager

def setup_driver():
    # Set up Chrome options
    chrome_options = Options()
    # chrome_options.add_argument("--headless")  # Run in headless mode
    chrome_options.add_argument("--disable-gpu")
    chrome_options.add_argument("--no-sandbox")
    chrome_options.add_argument("--disable-dev-shm-usage")
    chrome_options.add_argument("--incognito")  # Use incognito mode

    # Set user-agent to mimic a regular browser
    user_agent = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36"
    chrome_options.add_argument(f'user-agent={user_agent}')

    # Disable automation flags
    chrome_options.add_experimental_option("excludeSwitches", ["enable-automation"])
    chrome_options.add_experimental_option('useAutomationExtension', False)

    # Initialize the Chrome driver
    driver = webdriver.Chrome(service=Service(ChromeDriverManager().install()), options=chrome_options)

    # Bypass the detection of automated software
    driver.execute_cdp_cmd('Page.addScriptToEvaluateOnNewDocument', {
        'source': '''
            Object.defineProperty(navigator, 'webdriver', {
              get: () => undefined
            })
        '''
    })

    return driver

def get_search_results(driver, q):
    url = f"https://www.teamblind.com/kr/search/{q}"
    driver.get(url)
    wait = WebDriverWait(driver, 10)
    urls = []
    previous_height = driver.execute_script("return document.body.scrollHeight")

    while True:
        driver.find_element(By.TAG_NAME, 'body').send_keys(Keys.END)
        time.sleep(2)  # 페이지가 로드되는 시간을 기다림
        new_height = driver.execute_script("return document.body.scrollHeight")
        if new_height == previous_height:
            break  # 더 이상 새로운 글이 없으면 종료
        previous_height = new_height

    try:
        articles = wait.until(EC.presence_of_all_elements_located((By.CLASS_NAME, 'article-list-pre')))
        for article in articles:
            a_tag = article.find_element(By.CLASS_NAME, 'tit').find_element(By.TAG_NAME, 'a')
            if a_tag:
                full_url = a_tag.get_attribute('href')
                if full_url and full_url.startswith('http'):
                    urls.append(full_url)
                    print(f" URL: {full_url}")

    except Exception as e:
        print(f"Error extracting URLs: {e}")

    return urls

def get_post_details(driver, url, index):
    if not url or not isinstance(url, str):
        print(f"[{index}] Invalid URL: {url}, skipping.")
        return None

    print(f"[{index}] Fetching details from {url}")
    driver.get(url)
    obj = {}
    try:
        obj['사이트'] = "블라인드"
        obj['URL'] = url

        # 제목 추출
        title_element = driver.find_element(By.CSS_SELECTOR, '.article-view-head h2')
        if title_element:
            obj['제목'] = title_element.text.strip()
        else:
            obj['제목'] = "제목 없음"

        # 원문 추출
        content_element = driver.find_element(By.ID, 'contentArea')
        if content_element:
            obj['원문'] = content_element.text.strip()
        else:
            obj['원문'] = "내용 없음"

        # 날짜 추출
        date_element = driver.find_element(By.CLASS_NAME, 'date')
        if date_element:
            obj['날짜'] = date_element.get_attribute('textContent').strip().replace('작성일', '').strip()
        else:
            obj['날짜'] = "날짜 없음"

    except Exception as e:
        print(f"Error parsing post details from {url}: {e}")
        return None

    print(f"[{index}] obj: {obj}")
    return obj

def save_to_excel(data, file_name='teamblind_results.xlsx'):
    try:
        if os.path.exists(file_name):
            existing_df = pd.read_excel(file_name)
            combined_df = pd.concat([existing_df, pd.DataFrame(data)], ignore_index=True)
        else:
            combined_df = pd.DataFrame(data)

        with pd.ExcelWriter(file_name, engine='openpyxl', mode='w') as writer:
            combined_df.to_excel(writer, index=False)
        print(f"Data successfully saved to {file_name}")

    except Exception as e:
        print(f"Error saving to Excel: {e}")

